Первоначальная версия дома принадлежала архитектору Юргенсу Эммануилу Густавовичу. В 1902-1903 Джиоргули Антон Кириакович начал строительство нового дома на этом месте. Военный инженер Ланге Модест Фердинандович завершил строительство, включив существовавший дом. 
В этом доме жили: 1908-1913   архитектор Э. Ф. Виррих; 1921-1935   поэт, драматург, композитор  М. А. Кузмин; 1921-1922   писатель М. Л. Слонимский; 
1903-1904 архитектор Н. В. Султанов.

Здание сооружено в начале XIX века для казённого питейного дома (Дом Ш. З. Иофа с кинематографом).
1914—1918 гг. арх. Лангбард Иосиф Григорьевич, гражд. инж. Степанов Н. П. - перестройка Театра миниатюр в Петрограде;
В годы НЭПа здесь разместился кинотеатр «Нью-Стар», в предвоенные годы он стал называться «Ударник». В настоящее время — Дом молодежи «Рекорд».
